        void setInitialValue(string code, string numero, string libelle, string date)
        {
            textBoxNaftalCardCode.Text = code;
            textBoxNaftalCardNum.Text = numero;
            textBoxNaftalCardLibelle.Text = libelle;
            string[] a = date.Split(' ');
            string[] splitedDate = a[0].Split('/');
            dateExpNaftalCard.Value = new System.DateTime(int.Parse(splitedDate[2]), int.Parse(splitedDate[1]), int.Parse(splitedDate[0]), 0, 0, 0, 0); //dateValue

        }

